pragma solidity ^0.5.16;

import "./ZombieFeeding.sol";

contract ZombieHelper is ZombieFeeding {
    // withdraw  (ZombieHelper.sol)
    // 1. withdraw      
    // 2.    , levelUpFee 
    // setLevelUpFee(uint _fee)     owner  
    uint256 levelUpFee = 0.001 ether;

    modifier aboveLevel(uint256 _level, uint256 _zombieId) {
        require(zombies[_zombieId].level >= _level);
        _;
    }

    /**
     * withdraw:  parameter 
     */
    function withdraw(uint256 _amount) external onlyOwner {
        _withdraw(_amount);
    }

    /**
     * withdrawAll:  
     */
    function withdrawAll() external onlyOwner {
        _withdraw(address(this).balance);
    }


    function _withdraw(uint256 _amount) private onlyOwner {
        require(_amount <= address(this).balance);
        address payable owner = address(uint160(owner()));
        owner.transfer(_amount);
    }

    function levelUp(uint256 _zombieId) external payable {
        require(msg.value == levelUpFee);
        zombies[_zombieId].level = zombies[_zombieId].level.add(1);
    }

    // setLevelUpFee - levelUpFee    
    // 1. external( )
    // 2. owner   .
    function setLevelUpFee(uint256 _fee) external onlyOwner {
        // require(owner()==msg.sender) -->  setLevelUp  tx owner  tx
        // logic
        levelUpFee = _fee;
    }

    function changeName(uint256 _zombieId, string calldata _newName)
        external
        aboveLevel(2, _zombieId)
        zombieOwnerOf(_zombieId)
    {
        zombies[_zombieId].name = _newName;
    }

    function changeDna(uint256 _zombieId, uint256 _newDna)
        external
        aboveLevel(20, _zombieId)
        zombieOwnerOf(_zombieId)
    {
        zombies[_zombieId].dna = _newDna;
    }

    function getZombiesByOwner(address _owner)
        external
        view
        returns (uint256[] memory)
    {
        uint256[] memory result = new uint256[](ownerZombieCount[_owner]);

        uint256 zombieCount = 0;

        // 1.      .
        for (uint256 i = 0; i < zombies.length; i++) {
            // i: zombie id (index)
            if (_owner == zombieToOwner[i]) {
                // 2.     owner  .
                // 2-1.  owner _owner  result .
                result[zombieCount] = i;
                zombieCount = zombieCount.add(1);
            }
        }

        // 3.   result return.
        return result;
    }
}
